import React from 'react'

function pageImg(props) {
    
    const {img,text,buttonClass,buttonName} = props.values;
    
    return (
        <div style={{background: `url(${img})`}} className="pageImg">
            <div className="pageImgInfo">
                <p>{text}</p>
                <button className={buttonClass}>{buttonName}</button>
            </div>
        </div>
    )
}

export default pageImg;
